description.p:
Some embodiments provide methods of patterning a polymeric image on a substrate, each method comprising;
(a) depositing a layer of photocurable composition of any one of the compositions described herein on the substrate;
(b) irradiating a portion of the layer of photocurable composition with a light having appropriate wavelength(s), thereby providing a patterned layer of polymerized and unpolymerized regions. Certain other embodiments further comprise removing the unpolymerized region of the pattern.

In another preferred embodiment the method comprises
a) applying a layer of the photocurable composition of the present invention onto a surface; b) exposing the layer imagewise to actinic radiation to form an imaged cured cross-section;
c) applying a second layer of the photocurable composition onto the previously exposed imaged cross-section;
d) exposing the layer from step (c) imagewise to actinic radiation to form an additional imaged cross-section, wherein the radiation causes curing of the second layer in the exposed areas and adhesion to the previously exposed cross-section; and
e) repeating steps (c) and (d) in order to build up a three-dimensional article.
